// src/components/Header.js
import React from 'react';
import './Header.css';
import headshot from '../assets/images/Calvin.JPG';
import linkedinIcon from '../assets/images/Linkln.png';
import githubIcon from '../assets/images/github-mark-white.png';

function Header() {
  console.log("Header component is rendering");

  return (
    <header className="header">
      <nav className="nav">
        <ul className="nav-list">
          <li className="nav-item"><a href="#about">About</a></li>
          <li className="nav-item"><a href="#contact">Contact</a></li>
        </ul>
      </nav>
      <div className="profile">
        <img src={headshot} alt="Calvin Nguyen" className="headshot" />
        <h1>Calvin Nguyen</h1>
        <div className="social-links">
          <a href="https://www.linkedin.com/in/calvin-n-990a4a193" target="_blank" rel="noopener noreferrer">
            <img src={linkedinIcon} alt="LinkedIn" className="social-icon" />
          </a>
          <a href="https://github.com/narucalo" target="_blank" rel="noopener noreferrer">
            <img src={githubIcon} alt="GitHub" className="social-icon" />
          </a>
        </div>
      </div>
    </header>
  );
}

export default Header;
